struct Vector world_to_screen(struct Vector pos)
{
	pos.y -= bottomOfScreen;
	pos.y = screenHeight - pos.y;

	return pos;
}

void checkKey(bool* keyBool, unsigned char code)
{
	if (key1 == code && key2 == 0xE0)
	{
		*keyBool = true;
	}

	if (key1 == code && key2 == 0xF0)
	{
		*keyBool = false;
	}
}

void updateKeys()
{
	int data = *PS2_ptr;

	if (data & 0x8000)
	{
		key2 = key1;
		key1 = data & 0xFF;
	}

	checkKey(&leftArrow, 0x6B);
	checkKey(&rightArrow, 0x74);
}